import Loadable from "react-loadable"

// containers
import Home from "../client/components/App"
import About from "../containers/about"
import NotFound from "../containers/errors/NotFound"

// routes
export default [
  {
    routes: [
      {
        path: "/",
        exact: true,
        component: Home
      },
      {
        path: "/about",
        exact: true,
        component: About
      },
      // users page
      {
        path: "/users",
        exact: true,
        component: Users
      },
      {
        path: "/users/:username",
        exact: true,
        component: UserProfile
      },
      // default page (return 404)
      {
        path: "*",
        state: { fullscreen: true },
        exact: true,
        component: NotFound
      }
    ]
  }
]
